var t=Ember.HTMLBars.template({id:"FIi4Wpv/",block:'{"symbols":[],"statements":[[10,"div"],[14,0,"project-template borderleft"],[12],[2,"\\n  "],[10,"h1"],[12],[2,"Imagana"],[13],[2,"\\n  "],[10,"p"],[12],[2,"Un serious game à destination des personnes en situation d’illettrisme. Incarnez Mô, un personnage possédant le pouvoir de créer des objets à partir des phonèmes qui les composent. Utilisez cette capacité afin de franchir des obstacles."],[13],[2,"\\n\\n  "],[10,"div"],[14,0,"project-part t1"],[12],[2,"\\n    "],[10,"h2"],[12],[2,"Cinématique d\'introduction"],[13],[2,"\\n    "],[10,"div"],[14,0,"video"],[12],[2,"\\n      "],[10,"iframe"],[14,"title","Cinematique d\'introduction de Imagana"],[14,"width","640"],[14,"height","360"],[14,"src","https://www.youtube.com/embed/JGfgdKd0yrU"],[14,"frameborder","0"],[14,"allowfullscreen",""],[12],[2,"\\n      "],[13],[2,"\\n    "],[13],[2,"\\n  "],[13],[2,"\\n\\n  "],[10,"div"],[14,0,"project-part t2"],[12],[2,"\\n    "],[10,"h2"],[12],[2,"A propos"],[13],[2,"\\n    "],[10,"p"],[12],[2,"Imagana est un projet porté par la société Formagraph et sur lequel j\'ai travaillé pendant 9 mois au cours de son développement, d\'abord en tant que stagiaire de Formagraph, puis en tant que salariée de FremenCorp."],[13],[2,"\\n    "],[10,"p"],[12],[2,"Il s\'agit d\'un projet intelligent auquel je suis fière d\'avoir participé. C\'est un serious game qui ose être \\"un vrai jeu\\", un concept vers lequel tout serious game devrait tendre. Travailler sur ce projet a été très enrichissant."],[13],[2,"\\n  "],[13],[2,"\\n\\n  "],[10,"div"],[14,0,"project-part t1"],[12],[2,"\\n    "],[10,"h2"],[12],[2,"Liens"],[13],[2,"\\n    "],[10,"p"],[12],[2,"Jouez à Imagana depuis "],[10,"strong"],[12],[10,"a"],[14,"target","_blank"],[14,0,"important"],[14,6,"http://www.imagana.com/"],[14,"rel","noopener noreferrer"],[12],[2,"la page du jeu"],[13],[13],[2,". Vous pouvez le télécharger ou jouer directement en ligne."],[13],[2,"\\n    "],[10,"p"],[12],[2,"Pour en savoir plus sur le projet et son contexte, rendez-vous sur "],[10,"strong"],[12],[10,"a"],[14,"target","_blank"],[14,0,"important"],[14,6,"http://www.imagana.info/"],[14,"rel","noopener noreferrer"],[12],[2,"le site d\'information"],[13],[13],[2," du jeu."],[13],[2,"\\n    "],[10,"p"],[12],[2,"Consultez les dernières news sur "],[10,"strong"],[12],[10,"a"],[14,"target","_blank"],[14,0,"important"],[14,6,"http://www.facebook.com/imaganalejeu"],[14,"rel","noopener noreferrer"],[12],[2,"la page Facebook"],[13],[13],[2," du jeu."],[13],[2,"\\n  "],[13],[2,"\\n\\n  "],[10,"div"],[14,0,"project-part t2"],[12],[2,"\\n    "],[10,"h2"],[12],[2,"Vidéo de gameplay"],[13],[2,"\\n    "],[10,"div"],[14,0,"video"],[12],[2,"\\n      "],[10,"iframe"],[14,"title","Video de gameplay de Imagana"],[14,"width","640"],[14,"height","360"],[14,"src","https://www.youtube.com/embed/yhXU5FAoBwU"],[14,"frameborder","0"],[14,"allowfullscreen",""],[12],[2,"\\n      "],[13],[2,"\\n    "],[13],[2,"\\n    "],[10,"p"],[12],[2,"\\n      Cette vidéo de gameplay est ancienne, mais elle montre l\'état du projet à l\'époque où je travaillais dessus. J\'ai implémenté de nombreux éléments que vous voyez à l\'écran :\\n      "],[10,"ul"],[12],[2,"\\n        "],[10,"li"],[12],[2,"Tout d\'abord le système principal de slot de phonèmes qui permet de faire apparaître les \\"artéfacts\\" (objets contenus dans les sphères), et dont j\'ai participé au design."],[13],[2,"\\n        "],[10,"li"],[12],[2,"Le drag and drop des phonèmes, qui viennent se fixer au slot le plus proche."],[13],[2,"\\n        "],[10,"li"],[12],[2,"Egalement de nombreux FX comme la lumière des slots, le clignotement des obstacles sur lesquels poser les artéfacts, l\'animation des gemmes rouges vers le compteur de l\'UI..."],[13],[2,"\\n        "],[10,"li"],[12],[2,"J\'ai également écris le shader bleuté utilisé pour les artéfacts"],[13],[2,"\\n      "],[13],[2,"\\n      J\'ai implémenté encore bien d\'autres fonctionnalités sur Imagana, et travailler sur ce projet était un réel bonheur.\\n    "],[13],[2,"\\n  "],[13],[2,"\\n\\n  "],[10,"div"],[14,0,"project-part t1"],[12],[2,"\\n    "],[10,"h2"],[12],[2,"Univers"],[13],[2,"\\n    "],[10,"p"],[12],[2,"L\'univers d\'Imagana se veut coloré et fantaisiste. Les personnes en situation d\'illettrisme vivent parfois des moments difficiles au quotidien. L\'équipe de Formagraph ne souhaitait pas se diriger vers une direction artistique réaliste, qui aurait pu reproduire des schémas de tous les jours, plaçant le joueur dans un état d\'anxiété."],[13],[2,"\\n    "],[10,"p"],[12],[2,"Ainsi, le choix a été fait de placer le joueur dans un univers qui lui permet de rêver, et d\'apprendre à son rythme sans se soucier du monde réel."],[13],[2,"\\n  "],[13],[2,"\\n\\n  "],[10,"div"],[14,0,"project-part t2"],[12],[2,"\\n    "],[10,"h2"],[12],[2,"Annecdote"],[13],[2,"\\n    "],[10,"p"],[12],[2,"Pendant mon stage chez Formagraph, la pédagogue Danielle Chopinot m\'a emmenée à quelques sessions de playtest à l\'IFPA. J\'ai pu observer comment des joueurs en situation d\'illettrisme se comportaient avec les mécaniques que j\'avais implémentées, et j\'ai entrevu un univers qui m\'était jusqu\'alors inconnu."],[13],[2,"\\n  "],[13],[2,"\\n\\n"],[13]],"hasEval":false,"upvars":[]}',moduleName:"site-cv/templates/panels/imagana.hbs"})
